INSERT INTO `berita` (`id_berita`, `judul`, `isi`, `tanggal`, `status`, `gambar`, `id_user`) VALUES
(14, 'Penyebab Kematian Ibu di Kota Besar : Kemiskinan Hingga Istri ''Sambungan''', '<p><span style="font-size: small;">&nbsp;<strong>Jakarta,</strong> Ketika berbicara mengenai kematian ibu melahirkan, biasanya yang terlintas di pikiran banyak orang adalah kematian yang terjadi pada ibu hamil yang ingin melahirkan dan tinggal di desa terpencil atau pedalaman. Nyatanya, kematian ibu melahirkan juga tinggi di beberapa kota besar. </span><span style="font-size: small;">"Di Jawa Tengah, Semarang itu kan bisa dikatakan kota besar ya, angka kematian ibu (AKI)-nya sekitar 30. Itu penduduknya tingkat pendidikannya tinggi, transportasi pun mudah. Tapi AKI-nya tinggi," tutur dr Anung Sugihartono M.Kes dari Dirjen Bina Gizi dan Kesehatan Ibu dan Anak Kementerian Kesehatan.</span></p>\r\n<p><span style="font-size: small;">"Mengapa? Memang masih dipelajari sebabnya, tapi setidaknya kondisi yang mengancam saat mengandung seperti pre-eklampsi atau eklampsia kan kita nggak tahu ya atau misal saat si ibunya mengejan," imbuh Anung saat menjadi pembicara di Rapat Kerja Nasional Program Kependudukan, KB, dan Pembangunan Keluarga di Jakarta Convention Center, Jakarta, Rabu (12/2/2014).</span></p>\r\n<p><span style="font-size: small;">Anung menyimpulkan bahwa transportasi, tingkat pendidikan, dan kondisi ekonomi bukan satu-satunya faktor penyebab kematian ibu. Pria yang baru satu bulan bertugas di Dirjen Bina Gizi dan Kesehatan Ibu dan Anak Kementerian Kesehatan ini memang berasal dari Jawa Tengah. Sehingga, ia mengaku hafal mana wilayah di Jawa Tengah yang memiliki AKI tinggi.</span></p>\r\n<p><span style="font-size: small;">Beberapa wilayah yang memiliki AKI tinggi antara lain Brebes, Semarang, Pekalongan, Grobogan, Banyumas dan Cilacap. Di Brebes, AKI yang tinggi disebabkan masalah kultural di mana banyak wanita yang ditinggalkan suaminya untuk bekerja di luar kota.</span></p>\r\n<p><span style="font-size: small;">Akibatnya, proses pengambilan keputusan memakan waktu cukup lama karena si ibu harus berdiskusi dulu dengan orang tuanya. Sementara itu, kemiskinan menjadi penyebab tingginya AKI di Cilacap.</span></p>\r\n<p><span style="font-size: small;">"Kematian ibu tertinggi itu di Batang karena angka perceraian juga tinggi. Bahkan waktu itu saya amati ada empat orang umurnya di atas 35 tahun tapi harus hamil karena dia istri sambungan dan suaminya ingin anak dari wanita itu. Padahal ada juga riwayat penyakit tertentu," jelas Anung.</span></p>\r\n<p><span style="font-size: small;">Oleh karena itu, menurut Anung penyelesaian masalah yang dilakukan harus bersifat individual karena intervensi tidak cukup hanya dengan kebijakan makro.</span></p>\r\n<p><span style="font-size: small;">"Ini tantangan yang harus dihadapi. Kita fokus di sembilan provinsi ini. Di provinsi yang lain intervensi tetap kita jalankan sesuai program, hanya di 64 kabupaten ini intervensinya lebih bersifat individual dan intensitasnya juga lebih banyak," pungkas Anung. <br /></span></p>', '2014-07-18 07:23:44', 1, '180554_mombaby.jpg', '1'),
(15, 'Putri Citra Bela, Juara Umum Gebyar 1001 Poster BKKBN 2013', '<p style="text-align: justify;"><span style="font-size: small;"><strong>Jakarta,</strong> Dalam rangka mewujudkan remaja Indonesia yang lebih berkualitas, Badan Kependudukan dan Keluarga Berencana Nasional (BKKBN) mengadakan Lomba Gebyar 1001 Poster BKKBN 2013. Di tahun keempatnya, lomba poster ini mengumumkan sebagai juara umum.</span></p>\r\n<p style="text-align: justify;"><span style="font-size: small;">"BKKBN menawarkan upaya persiapan keluarga bagi remaja melalui berbagai media, saat ini melakukan pendekatan dalam seni berupa poster. Seni sebagai bahasa universal mampu menembus bahasa kehidupan," ungkap ketua panitia lomba, Yunus Patriawan Noya, MSi, dalam acara pengumuman yang diselenggarakan di Theater Keong Mas TMII, Jakarta, Minggu (24/11/2013).</span></p>\r\n<p style="text-align: justify;"><span style="font-size: small;">Dengan mengangkat tema &lsquo;&rsquo;Yang Muda, Yang Berencana&rsquo;&rsquo; dan sub tema &lsquo;&rsquo;Menikah di Usia Ideal&rsquo;&rsquo;, kegiatan ini kali keempat dilaksanakan sejak bulan September tahun ini.</span><br /><span style="font-size: small;"> "Tahun ini dari seluruh Indonesia terkirim 1.568 poster. Ini merupakan rekor selama 4 kali lomba poster," terang Yunus.</span></p>\r\n<p style="text-align: justify;"><span style="font-size: small;">Lomba ini dibagi menjadi tiga kategori, yaitu usia 10-13 tahun; usia 14-17 tahun; dan usia 18-24 tahun, manual maupun digital. Para pemenang akan mendapatkan hadiah berupa piala, piagam dan uang masing-masing untuk juara 1 Rp 25 juta, untuk juara 2 Rp 20 juta, dan untuk juara 3 Rp 15 juta.</span><br /><span style="font-size: small;"> "Provinsi pengirim poster terbanyak adalah Jawa Timur, Riau, dan Maluku," ujar Yunus.</span></p>\r\n<p style="text-align: justify;"><span style="font-size: small;">Dewan juri dalam lomba ini terdiri dari berbagai ahli diantaranya Arswendo Atmowiloto (jurnalis dan budayawan), Moeryono Aladin (mitra BKKBN/SIKIB), Arif Priyono SA (akademisi/BINUS), Uung Kusmana (BKKBN Pusat) dan Sony Wibisono (praktisi desain).</span></p>', '2014-07-18 09:07:33', 1, 'poster2-ajeng.jpg', '1');
